import React from 'react';
import ReactDOM from 'react-dom/client';
import Quiz from './components/Quiz';
import "./index.css"
import { QuizProvider } from './contexts/quiz';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <QuizProvider/>
    <Quiz />
  </React.StrictMode>
);
